import axios from 'axios';
import React from 'react';
//import {Line} from 'chart.js'; 
import CovidTrackerService from '../services/CovidTrackerService';

class CovidTrackerComponent extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            country: [] 
        };
    }

    componentDidMount() {
        CovidTrackerService.getData().then((response) => {
            this.setState({country: response.data});
            console.log("Country: " + this.state.country);
        });
    }

    render() {
        return (
            <div>
                <h1> Data </h1>
                <table>
                    <thead>
                        <tr>
                            <td> Name</td>
                            <td> Code</td>
                            <td> Population </td>
                            <td> Latest Data </td>
                            <td> Timeline </td>
                        </tr>
                    </thead>
                </table>
            </div>
        )
    }
}

export default CovidTrackerComponent;
